INSERT INTO osdb_symptoms (name, description) VALUES ("Xerostomia", "Dry mouth, or xerostomia (zeer-o-STOE-me-uh), refers to any condition in which your mouth is unusually dry. Most often, dry mouth is the result of a decrease in saliva produced by the glands in your mouth (salivary glands), and it's frequently a side effect of medication.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Prexia", "Raised body temperature.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Abdominal Pain", "Abdominal pain is pain that you feel anywhere between your chest and groin. This is often referred to as the stomach region or belly.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Epistaxis", "Bleeding from the nose.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Tremors", "An involuntary quivering movement.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Convulsions", "A sudden, violent, irregular movement of the body, caused by involuntary contraction of muscles and associated especially with brain disorders such as epilepsy, the presence of certain toxins or other agents in the blood, or fever in children.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Muscle Cramps", "A muscle cramp is a sudden and involuntary contraction of one or more of your muscles. If you've ever been awakened in the night or stopped in your tracks by a sudden charley horse, you know that muscle cramps can cause excruciating pain.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Tinnitus", "Ringing or buzzing in the ears.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Dizziness/Vertigo", "Dizziness is a term used to describe a range of sensations, such as feeling faint, woozy, weak or unsteady. Dizziness that creates the false sense that you or your surroundings are spinning or moving is called vertigo.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Syncope", "A temporary loss of consciousness caused by a fall in blood pressure.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Sweats", "Moisture exuded through the pores of the skin, typically in profuse quantities as a reaction to heat, physical exertion, fever, or fear.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Agoraphobia", "Extreme or irrational fear of open or public places.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Alexia", "Inability to recognize or read written words or letters, typically as a result of brain damage.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Dystonia", "A state of abnormal muscle tone resulting in muscular spasm and abnormal posture.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Euphoria", "A feeling or state of intense excitement and happiness.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Hallucination", "An experience involving the apparent perception of something not present.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Headache", "A continuous pain in the head.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Homicidal Ideation", "A common medical term for thoughts about homicide. There is a range of homicidal thoughts which spans from vague ideas of revenge to detailed and fully formulated plans without the act itself.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Insomnia", "Habitual sleeplessness; inability to sleep.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Parasthesia", "An abnormal sensation, typically tingling or pricking (pins and needles), caused chiefly by pressure on or damage to peripheral nerves.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Prosopagnosia", "The inability to recognize the faces of familiar people, typically as a result of damage to the brain.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Claustrophobia", "Extreme or irrational fear of confined places.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Sciatica", "Pain affecting the back, hip, and outer side of the leg, caused by compression of a spinal nerve root in the lower back, often owing to degeneration of an intervertebral disc.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Double Vision", "The simultaneous perception of two images, usually overlapping, of a single scene or object.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Exophthalmos", "Abnormal protrusion of the eyeball or eyeballs.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Constipation", "A condition in which there is difficulty in emptying the bowels, usually associated with hardened faeces.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Diarrhea", "A condition in which faeces are discharged from the bowels frequently and in a liquid form.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Nausea", "A feeling of sickness with an inclination to vomit.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Claudication", "A condition in which cramping pain in the leg is induced by exercise, typically caused by obstruction of the arteries.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Tachycardia", "An abnormally rapid heart rate.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Impotence", "An abnormal physical or psychological state of a male characterized by inability to engage in sexual intercourse because of failure to have or maintain an erectioncalled also erectile dysfunction.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Hyperventilation", "A condition in which you suddenly start to breathe very quickly. Healthy breathing occurs with a healthy balance between breathing in oxygen and breathing out carbon dioxide.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Haemoptysis", "The coughing up of blood.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Rash", "A rash is a change of the skin which affects its color, appearance, or texture. A rash may be localized in one part of the body, or affect all the skin. Rashes may cause the skin to change color, itch, become warm, bumpy, chapped, dry, cracked or blistered, swell, and may be painful.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Dysgraphia", "Inability to write coherently, as a symptom of brain disease or damage.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Dysarthria", "Difficult or unclear articulation of speech that is otherwise linguistically normal.");
INSERT INTO osdb_symptoms (name, description) VALUES ("Confusion", "The state of being bewildered or unclear in one's mind about something.");
